import React from "react";
import Books from "data/Books";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";

const Navbar = () => {
	return (
		<div class="topnav">
			<Link to="/{Books.slug}">{Books.title}</Link>
		</div>
	);
};
export default Navbar;
